import React from 'react';

function MoodReportModal({ user, onClose, onUpgradeClick }) {
    if (!user.is_premium) {
        return (
            <div className="modal-overlay" onClick={onClose}>
                <div className="premium-upsell-box" onClick={(e) => e.stopPropagation()}>
                    <button className="close-btn" onClick={onClose}>Ã—</button>
                    <div className="lock-icon">ðŸ“Š</div>
                    <h3>Unlock Mood Reports</h3>
                    <p>Get detailed insights and graphical charts of your mood trends by upgrading to Premium.</p>
                    <button onClick={onUpgradeClick} className="upgrade-btn">âœ¨ Upgrade Now</button>
                </div>
            </div>
        );
    }
    
    // Mood report data would be fetched and passed as a prop
    const moodReportData = { happy: 10, sad: 3, anxious: 5 };

    return (
        <div className="modal-overlay" onClick={onClose}>
            <div className="modal-content large">
                <div className="modal-header">
                    <h2>ðŸ“Š Your Mood Report</h2>
                    <button onClick={onClose} className="close-btn">Ã—</button>
                </div>
                <div className="report-content">
                    <h4>Mood Distribution</h4>
                    <div className="mood-chart">
                        {Object.entries(moodReportData).map(([mood, count]) => (
                            <div key={mood}><strong>{mood}:</strong> {count} entries</div>
                        ))}
                    </div>
                </div>
            </div>
        </div>
    );
}

export default MoodReportModal;
